import React from 'react';

export class MovieItem extends React.Component{

    render(){
        return(
            <div>
                <h3>{this.props.movie.Title}</h3>
                <h3>{this.props.movie.Year}</h3>
                <img>{this.props.movie.Poster}</img>
            </div>
        )
    }
}
